import "./App.css";
import Home from "./Components/Home/Home";
import { BrowserRouter, Router, Switch } from "react-router-dom";
function App() {
  return (
    <BrowserRouter>
      <div className="App bg-dark ">
        <Switch>
          <Router exact path="/home" component={Home} />
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
